import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Card from './components/Card.js'

class App extends Component {
  render() {
    return (
      <div className="container">
      <TopBar></TopBar>
        <Card></Card>
      </div>
    );
  }
}

export default App;
